o.x:
var $bm_rt;
if (thisComp.layer('Control Layer').effect('on/off Shadow')('ADBE Checkbox Control-0001') == 1)
    $bm_rt = 25;
else
    $bm_rt = 0;

s.x:
var $bm_rt;
var n, t, n, t, amp, freq, decay, angle, scaleFact;
n = 0;
t = 0;
if (marker.numKeys > 0) {
    n = marker.nearestKey(time).index;
    if (marker.key(n).time > time)
        n--;
}
if (n > 0)
    t = $bm_sub(time, marker.key(n).time);
amp = 15;
freq = 2;
decay = 4, 0;
angle = $bm_mul($bm_mul($bm_mul(freq, 2), Math.PI), t);
scaleFact = $bm_div($bm_sum(100, $bm_div($bm_mul(amp, Math.sin(angle)), Math.exp($bm_mul(decay, t)))), 100);
$bm_rt = [
    value[0] * scaleFact,
    value[1] / scaleFact
];

